import logo from './logo.svg';
import './App.css';
import {Link} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          SELAMAT DATANG DI APLIKASI INVENTORY
        </p>
        <Link to="/home">Mulai</Link>
      </header>
    </div>
  );
}

export default App;
